import React from "react";
import { Link } from "react-router-dom";
import Logo from "../img/logo_pb_w.svg";
import "../css/main.css";

const Footer = () => {
  return (
    <footer className="container footer__container">
      <ul className="footer__tags">
        <li>
          <Link to="/profile/:id/:name/books">Books</Link>
        </li>
        <li>
          <Link to="/collections/tags/coins">Coins</Link>
        </li>
        <li>
          <Link to="/collections/tags/watches">Watches</Link>
        </li>
        <li>
          <Link to="/collections/tags/stamps">Stamps</Link>
        </li>
        <li>
          <Link to="/collections/tags/rings">Rings</Link>
        </li>
        <li>
          <Link to="/collections/tags/glasses">Glasses</Link>
        </li>
      </ul>
      <Link to="/" className="nav__logo-link">
        <img src={Logo} alt="publicburo" className="nav__logo" />
      </Link>
    </footer>
  );
};

export default Footer;
